exports.calculateCUSUM =
  function calculateCUSUM(data, CUSUM_K, BASELINE, GUARDBAND, MIN_SIGMA, RESET_LEVEL) {
    // Initialize Parameters
    //  CUSUM_K = 0.5;
    //  BASELINE = 28;
    //  GUARDBAND = 2;
    //  MIN_SIGMA = 0.5;
    //  RESET_LEVEL = 4;
    //  THRESHOLD_PROBABILITY_RED_ALERT = 0.01;
    //  THRESHOLD_PROBABILITY_YELLOW_ALERT = 0.05;
    var ndxBaseline = [], testBase = [], baselineData = [], statLookupVals = [], ndxOK = [];
    var sigma, baselineMean, zStat, carryOver;

    statLookupVals = openMath.valueVec(0, data.length);
    carryOver = 0;

    var pvalues = openMath.valueVec(null, data.length);
    var expectedData = openMath.valueVec(0, data.length);
    var testStat = openMath.valueVec(null, data.length);

    for (var i = 0; i < BASELINE; i++) {
      ndxBaseline.push(i);
    }

    for (i = BASELINE + GUARDBAND; i < data.length; i++) {

      testBase = openMath.subset2(data, ndxBaseline);
      ndxOK = baseline.filterBaselineZeros(testBase);
      baselineData = openMath.subset2(testBase, ndxOK);

      if (baselineData.length > 1) { // min 2 needed - stdev
        sigma = Math.max(openMath.std(baselineData), MIN_SIGMA);
        baselineMean = openMath.average(baselineData);
        expectedData[i] = baselineMean;
        zStat = (data[i] - baselineMean) / sigma;

        if (testStat[i - 1] > RESET_LEVEL) {
          carryOver = 0.5 * RESET_LEVEL;
        } else {
          carryOver = Math.max(0, testStat[i - 1]);
        }

        testStat[i] = Math.max(0, carryOver + zStat - CUSUM_K);
      } else {
        if (data[i] > 0) {
          testStat[i] = data[i];
        }
      }
      openMath.arrayAdd(ndxBaseline, 1);
    }

    for (i = BASELINE + GUARDBAND; i < data.length; i++) {
      statLookupVals[i] = Math.max(minLT, Math.min(maxLT, testStat[i]));
      pvalues[i] = openMath.interp1(lookupTable[0], lookupTable[1], statLookupVals[i]);
    }
    return {
      pValues: pvalues,
      testStats: testStat
    };
  };



